import { Grid } from '@material-ui/core'
import { makeStyles } from '@material-ui/styles'
import React from 'react'
import InputTextField from '../../_components/_inputs/InputTextField'


const styles = makeStyles({
    root:{
        display: 'flex',
        flexDirection:'row'
    }
})

interface IProps{
    value: string
    img?: any
    isReadonly: boolean
    onValueChanged: (title: string) => void
}

const MenuInputComponent: React.FC<IProps> = (props) =>{

    const {value, isReadonly, img, onValueChanged} = props

    const useStyle = styles()

    return(
        <Grid
            className={useStyle.root}
            container>
            <Grid
                item>
                {!isReadonly &&(
                    <InputTextField value={value} onValueChange={onValueChanged} label='Name'/>
                )}
            </Grid>
            <Grid
                item>

            </Grid>
        </Grid>
    )
}

export default MenuInputComponent
